def kmer_counting(seq, k=20, upper_bound=1, error_prob=0.000002):
    kmer_dict = {}
    kmer_pos = {}
    kmers = []
    for i in range(len(seq) - k + 1):
        kmer = seq[i:i + k]
        if kmer not in kmer_pos:
            kmer_pos[kmer] = list()
        kmer_pos[kmer].append(i)

        kmers.append(kmer)
        if kmer not in kmer_dict.keys():
            kmer_dict[kmer] = 1
        else:
            kmer_dict[kmer] += 1
    high_occ_kmers = [{'kmer': i, 'startpos': elem, 'endpos': elem + k, 'errorprob': v ** 2 * error_prob} for i, v in
                      kmer_dict.items() if v > upper_bound for elem in kmer_pos[i]]

    if high_occ_kmers:
        return high_occ_kmers  # sum(list(zip(*high_occ_kmers.values()))[1]), high_occ_kmers
    else:
        return {}


if __name__ == "__main__":
    print(kmer_counting(
        ""))
    print(kmer_counting("ACGTACGTACGTACGTACGTACGTACGTACGTACGTACGT"))
